!(function (c) {
  "use strict";
  c(function () {
    var o = function () {
      c("#mhk-modal-select-form").length &&
        ((c("#mhk-modal-select-form").get(0).selectedIndex = 0),
        c("#mhk-modal-checkbox-title, #mhk-modal-checkbox-description").prop(
          "checked",
          !1
        )),
        c("#mhk-modal-backdrop, #mhk-modal-wrap").css("display", "none"),
        c(document.body).removeClass("modal-open");
    };
    c(document).on("click", ".mhk-insert-form-button", function (e) {
      e.preventDefault(),
        c("#mhk-modal-backdrop, #mhk-modal-wrap").css("display", "block"),
        c(document.body).addClass("modal-open");
    }),
      c(document).on(
        "click",
        "#mhk-modal-close, #mhk-modal-cancel a",
        function (e) {
          e.preventDefault(), o();
        }
      ),
      c(document).on("click", "#mhk-modal-submit", function (e) {
        e.preventDefault(),
          (e = '[everest_form id="' + c("#mhk-modal-select-form").val() + '"'),
          c("#mhk-modal-checkbox-title").is(":checked") &&
            (e += ' title="true"'),
          c("#mhk-modal-checkbox-description").is(":checked") &&
            (e += ' description="true"'),
          (e += "]"),
          wp.media.editor.insert(e),
          o();
      });
  });
})(jQuery);
